import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello World React!</h1>
      <h2>Emmet configuered</h2>
      <select name="Email" id="231"></select>
      <h3>Cole aqui o seu email rapá</h3>
      <title>Mas o que é isso</title>
      <Embed>http://www.uol.com.br</Embed>
    </div>
  );
}

export default App;
